import React from 'react'
import { BrowserRouter as Router} from 'react-router-dom'
import { TopBar } from './parts/TopBar'
import { useRoutes } from './router'
function App() {
  const routes = useRoutes()
  const topbar = TopBar()
  return (
    <div>
    <TopBar />
    <Router>
      {routes}
    </Router></div>
  )
}

export default App;
